0e91a9994820bdea498e71ad65502cee75870a2f:
query GetAllVehicles {
  vehicles(first: 25, orderBy: blockTimestamp, orderDirection: desc) {
    id
    partner
    vin
    displayName
    blockNumber
    blockTimestamp
    transactionHash
  }
}

7e99a6f2a3237c985dbe7877a1ce34e045459039:
query GetVehicles($partner: Bytes) {
  vehicles(
    first: 25
    orderBy: blockTimestamp
    orderDirection: desc
    where: {partner: $partner}
  ) {
    id
    partner
    vin
    displayName
    blockNumber
    blockTimestamp
    transactionHash
  }
}
